    'sexualwarningbody.SexualWarning_02_Body': {value: '<p><strong>Al hacer clic en \u201CAcepto las Condiciones de uso y quiero visitar la secci\xF3n Personales\u201D, certifico:</strong></p><ul><li>Tengo al menos 18 a\xF1os.</li><li>Entiendo que la secci\xF3n <strong>Personales</strong> puede incluir contenido sexualmente expl\xEDcito.</li><li>Me comprometo a no subir im\xE1genes pornogr\xE1ficas, im\xE1genes o ilustraciones de personas que no han dado su consentimiento expl\xEDcito, im\xE1genes de personas menores de 18 a\xF1os, especialmente de ni\xF1os.</li><li>Respetar\xE9 las leyes de Propiedad Intelectual de las im\xE1genes.</li><li>No publicar\xE9 un anuncio proponiendo o sugiriendo favores sexuales a cambio de pagos o compensaciones de ninguna naturaleza.</li><li>Me comprometo a marcar como \u201Cprohibido\u201D cualquier anuncio que vea que es ilegal o que viole las <a href="%s" onclick="window.open(this.href); return false;"><strong>Condiciones de uso de OLX</strong></a> y me comprometo a informar cualquier sospecha de explotaci\xF3n de menores a las autoridades correspondientes.</li><li>Entiendo que OLX no puede ser culpado por el mal uso de su servicio. Violar las condiciones de uso puede llevar a la eliminaci\xF3n inmediata de mis anuncios o de mi cuenta y a ser enjuiciado por las autoridades correspondientes.</li></ul>', index: 1220},
