    'about.About': {value: '<!-- BEGIN MAIN BODY -->  <table class="resize" width="900" bgcolor="#ffffff" border="0" cellspacing="0" cellpadding="0">     <tr><td height="30" colspan="2" bgcolor="#FFB18C" class="titOLX"><span class="titolx1">Acerca de OLX</td></tr>  </table>  <table class="resize" width="900" bgcolor="#ffffff" border="0" cellspacing="0" cellpadding="0">     <tr valign="top">    <!-- BEGIN MAIN PAGE COLUMN -->  <th align="left" class="MainBodyBkgrdBrdr" scope="col"> <table width="900" border="0" cellspacing="0" cellpadding="0" align="left">    <tr>     <th align="left" valign="top" class="MainBodyBkgrd"><table width="900" border="0" cellspacing="5" cellpadding="5" align="left">  <tr>    <td>     <table width="100%" border="0" cellspacing="0" cellpadding="0" align="left" class="cuadro">        <tr> <td><table width="100%" bgcolor="#ffffff" border="0" cellspacing="0" cellpadding="0"> <tr><td align="left" class="aviso2"><br />OLX es un servicio de clasificados de \xFAltima generaci\xF3n que ofrece una experiencia m\xE1s localizada a nivel global. Como tal, OLX ayuda a crear una web social ofreciendo un servicio gratuito y de f\xE1cil uso para la   comunidad online, permitiendo a los usuarios que intercambien y vendan sus productos, conozcan gente, encuentren un apartamento, consigan un trabajo, compartan sus opiniones y mucho m\xE1s.</br><br />Construimos OLX bas\xE1ndonos en la experiencia de encontrar sitios ya existentes de subastas limitados y costosos, mientras que los sitios de clasificados tradicionales no tienen caracter\xEDsticas claves para brindar un servicio p\xFAblico a la comunidad realmente apropiado.<br /></td></tr> <tr><td align="left" class="aviso2"><br />Para proveer un mejor servicio hemos decidido incluir:<br /><ul><li>Una base de datos de ciudades, barrios y c\xF3digos postales para cubrir un pa\xEDs entero y no s\xF3lo las ciudades preseleccionadas.</li><li>Un campo de distancia que le permite ver anuncios dentro de un margen cercano a su c\xF3digo postal en los pa\xEDses en los cuales sea posible.</li><li>B\xFAsquedas avanzadas que tienen variables seg\xFAn las preferencias regionales.</li><li>Opciones de Subasta y de Compra Inmediata; integraci\xF3n de Paypal y de un sistema de relevancia en la categor\xEDa En Venta.</li><li>Una p\xE1gina de Mi OLX donde pueda hacer un seguimiento de sus anuncios, mensajes, etc.</li><li>La posibilidad para anunciar productos en mundos virtuales como, por ejemplo, SecondLife.</li><li>La posibilidad para incluir videos y fotos en sus anuncios.</li><li>Editor Ajax WYSIWYG para anuncios m\xE1s enriquecidos.</li><li>Formato RRS.</li><li>C\xF3digo HTML que puede introducirse en WorldNow, Xanga, o en su blog para publicitar sus anuncios.</li><li>La posibilidad de comentar sobre los anuncios para crear una comunidad m\xE1s fuerte.</li><li>La posibilidad de publicar anuncios en cualquier pa\xEDs y en cualquier idioma.</li><li>La posibilidad de ver el sitio en cualquier pa\xEDs y en cualquier idioma.</li><li>Alcance global.</li><li>Versi\xF3n para m\xF3viles (celulares; o tel\xE9fonos m\xF3viles).</li></ul>La compa\xF1\xEDa fue fundada en Marzo desde 2006 y es conducida de forma privada.<br /><br /></td></tr></table></td>        </tr>      </table>    </td>  </tr></table><br /><br />     </th>    </tr>         </table>  </th><!-- END MAIN PAGE COLUMN --> </tr></table>', index: 4930},
    'about.AboutBrand': {value: 'Acerca de OLX', index: 4931},
    'about.AboutText1': {value: 'OLX es la plataforma de clasificados l\xEDder en el mundo centrada en mercados emergentes, a trav\xE9s de equipos m\xF3viles e internet.', index: 4932},
    'about.AboutText2': {value: 'OLX opera de manera global y tiene presencia en m\xE1s de 40 pa\xEDses.', index: 4933},
    'about.about_Body': {value: '<p>OLX es la pr\xF3xima generaci\xF3n de anuncios gratis online.<br /><br />OLX brinda una soluci\xF3n simple para las complicaciones que implican la venta, la compra, el intercambio, el trato, la organizaci\xF3n y el encuentro con gente cerca de ti, dondequiera que te encuentres.<br /><br />En OLX puedes:<br /><ul><li>Dise\xF1ar f\xE1cilmente anuncios con fotos.</li><li>Controlar tus ventas, compras y tu actividad en la comunidad Mi OLX.</li><li>Mostrar tus anuncios en tus perfiles de redes sociales  (Facebook, Myspace, entre otros).</li><li>Acceder al sitio desde tu tel\xE9fono celular.</li><li>Ver OLX en tu propio idioma.</li></ul><br />OLX es usado en m\xE1s de <<QTY_COUNTRIES>> pa\xEDses en <<QTY_LANGUAGES>> idiomas. La compa\xF1\xEDa se fund\xF3 en marzo de 2006 y es dirigida en forma privada.</p>', index: 4934},
    'about.about_Title': {value: 'Acerca de OLX', index: 4935},
    'about.AdDescription': {value: 'Descripci\xF3n del anuncio:', index: 4936},
