    'about.BrandHasOfficesInNYAndBA': {value: 'OLX tiene sedes en Nueva York, Estados Unidos (485 7th Avenue, suit 507, New York, 10018) y en Buenos Aires, Argentina (Uriarte 2489, 1er Piso, 1425).', index: 4938},
    'about.BuyersForAllYouSell': {value: 'En OLX, hay compradores para casi todo lo que quieras vender.</br>Millones de personas ya vendieron sus productos en  OLX. \xA1Hazlo t\xFA tambi\xE9n!', index: 4939},
