    'about.FastAndEasy': {value: 'OLX es una manera r\xE1pida y f\xE1cil de vender lo que quieras. <strong>\xA1Y es gratis!</strong>', index: 4952},
    'about.GeneralCounsel': {value: 'Asesor Jur\xEDdico', index: 4953},
    'about.History': {value: 'Historia', index: 4954},
    'about.HistoryText1': {value: 'OLX fue fundada en 2006 por los empresarios de internet, Fabrice Grinda y Alec Oxenford en Argentina. Hoy es una de las principales plataformas de clasificados gratuitos en l\xEDnea del mundo, disponible en m\xE1s de 40 pa\xEDses y en 50 idiomas.', index: 4955},
    'about.HistoryText2': {value: 'Todos los d\xEDas, millones de personas de todo el mundo usan OLX para comprar y vender productos, carros, encontrar empleo o alquilar una casa. La plataforma de OLX tiene m\xE1s de 200 millones de usuarios por mes que generan un tr\xE1fico superior a once mil millones de visitas mensuales a la p\xE1gina o cerca de 360 millones de visitas por d\xEDa. El grupo tiene 1200 empleados en sus oficinas de Buenos Aires, Ciudad del Cabo, Delhi, San Pablo, R\xEDo de Janeiro, Lisboa y Nueva York.', index: 4956},
    'about.HistoryText3': {value: 'En agosto de 2010, Naspers adquiri\xF3 inicialmente el 67,8% en participaciones de OLX.inc y, posteriormente, aument\xF3 al 95%. Como parte de una iniciativa para transformar OLX en la marca m\xE1s importante del mundo para las transacciones de consumidor a consumidor (C2C), Naspers acaba de consolidar sus servicios de clasificados en l\xEDnea en Filipinas, Tailandia, Polonia, Hungr\xEDa, Bulgaria, Rumania e Indonesia, y renombr\xF3 la marca como OLX.', index: 4957},
