    'about.PostingBalloonTip_Email_0_0': {value: 'Escribe tu nombre real para que los compradores sepan c\xF3mo llamarte cuando te contacten. No es necesario que escribas tu nombre completo.', index: 4980},
    'about.Presence': {value: 'Presencia', index: 4981},
    'about.SellingIsEasy': {value: 'Vender es f\xE1cil', index: 4982},
    'about.SellThings': {value: 'Vende ese tel\xE9fono usado que tienes guardado en el caj\xF3n.</br>Vende esa guitarra que, en realidad, nunca usaste.</br>Vende el cochecito de beb\xE9 que era de tu hermana y que sigue escondido en el cl\xF3set.</br>Vende tu moto y c\xF3mprate una nueva.</br>Vende esos zapatos que ya no te quedan.</br>Vende tu carro.</br>', index: 4983},
    'about.Spam': {value: '', index: 4984},
    'about.Stats': {value: 'Estad\xEDsticas', index: 4985},
