    'about.Test': {value: 'Testteteteetetetetet', index: 4988},
    'about.WeekendTakesLonger': {value: 'Es posible que los anuncios publicados durante la noche o los fines de semana tarden m\xE1s en aparecer activos. No vuelvas a publicarlo.', index: 4989},
    'about.WithinTime': {value: '<li>En cuesti\xF3n de segundos, puedes publicar un art\xEDculo para vender (\xA1usa tu tel\xE9fono m\xF3vil!).</li><li>Y, en minutos, tu art\xEDculo aparecer\xE1 en OLX.</li><li>En pocas horas, los compradores interesados se comunicar\xE1n contigo.</li><li>En pocos d\xEDas, podr\xE1s conocer a los compradores y cambiar el art\xEDculo que quisiste vender por efectivo.</li><li>Y, en tan solo semanas, habr\xE1s simplificado y mejorado tu vida.</li>', index: 4990},
    'mail_crm.AntiFraudInfo': {value: 'Para m\xE1s informaci\xF3n y consejos de seguridad, visita nuestro <a href="<<ForumLink>>">foro anti-fraude </a> o nuestra <a href="<<Help26Link>>">secci\xF3n de Ayuda</a>.</p>', index: 4991},
    'mail_crm.CongratulationsForPostingYourFirstAdOnBrand': {value: '\xA1Felicitaciones por publicar tu primer anuncio en OLX!', index: 4992},
    'mail_crm.ContactUsLink': {value: '<<CONTACTLINK>>Cont\xE1ctanos<</CONTACTLINK>>', index: 4993},
    'mail_crm.CRM1_Bullet_1': {value: '<<LI_MARGIN_5PX>><strong> NUNCA vendas nada a nadie fuera de tu pa\xEDs de residencia. </strong><br />Una orden de pago de un banco extranjero puede tardar de 3 a 4 semanas o m\xE1s en ser procesada por tu banco. Mientras tanto, el monto se acredita en tu cuenta, pero si el pago es falso, este monto se debitar\xE1 de tu cuenta.<</LI_MARGIN_5PX>>', index: 4994},
    'mail_crm.CRM1_Bullet_2': {value: '<<LI_MARGIN_5PX>><strong> Nunca aceptes cheques de caja de bancos extranjeros.</strong><br /> La mayor\xEDa de los estafadores usa y env\xEDa versiones falsas de este tipo de cheques.<</LI_MARGIN_5PX>>', index: 4995},
    'mail_crm.CRM1_Bullet_3': {value: '<<LI_MARGIN_5PX>><strong>NUNCA aceptes un pago por un monto superior al valor del producto. </strong><br />NUNCA env\xEDes dinero para reembolsar un sobrepago, cualquiera sea la raz\xF3n que te dieron (regalo, costos de env\xEDo, cargos de aduana, cargos por intermediarios, etc.)<</LI_MARGIN_5PX>>', index: 4996},
    'mail_crm.CRM1_Bullet_4': {value: '<<LI_MARGIN_5PX>><strong>Si el comprador se presenta como intermediario (abogado, asesor u otro) en representaci\xF3n de un cliente extranjero, NO ACEPTES la venta.</strong><</LI_MARGIN_5PX>>', index: 4997},
    'mail_crm.CRM1_Bullet_5': {value: '<<LI_MARGIN_5PX>><strong>OLX nunca toma partido en negociaciones o transacciones. </strong><br />No facilitamos pagos ni env\xEDos; no proveemos garant\xEDa alguna de satisfacci\xF3n de producto; y no ofrecemos ning\xFAn servicio de financiamiento o protecci\xF3n financiera para compradores ni vendedores.<</LI_MARGIN_5PX>>', index: 4998},
    'mail_crm.CRM1_Bullet_6': {value: '<<LI_MARGIN_5PX>> <strong>Nunca des informaci\xF3n financiera</strong><br /> Por ejemplo, tu n\xFAmero de cuenta bancaria, CBU, etc. <</LI_MARGIN_5PX>>', index: 4999},
    'mail_crm.CRM1_Bullet_7': {value: '<<LI_MARGIN_5PX>> <strong> S\xE9 extremadamente precavido en caso de que tengas que enviar el producto por correo, barco u otros servicios de transporte o encomiendas. </strong><</LI_MARGIN_5PX>>', index: 5000},
    'mail_crm.CRM1_Bullet_8': {value: '<<LI_MARGIN_5PX>><strong>Si recibes e-mails en los que se te comunica que has ganado un premio y que debes pagar para recibirlo, no lo contestes y comun\xEDcate con nuestro</strong> <<CONTACTLINK>>Equipo de atenci\xF3n al cliente<</CONTACTLINK>><</LI_MARGIN_5PX>>.', index: 5001},
    'mail_crm.CRM_FirstPost_02_Body': {value: '<p><strong>Felicitaciones por publicar tu primer anuncio en OLX: <<ItemTitle>></strong></p><p>Te recomendamos conservar este email, puedes encontrarlo \xFAtil para futuras transacciones en sitios de subastas o clasificados.</p><p>Te recomendamos operar localmente, de esta manera, ambas partes se pueden conocer en persona antes de proceder.</p><p>Sin embargo, si el potencial comprador/vendedor no esta en tu area, aqui tienes algunas recomendaciones que deberias tener en mente:</p><ol style="border-top:1px solid #DCDCDC;border-bottom:1px solid #DCDCDC;background-color:#E9E9E9; padding-right:5px;"><li style="margin: 5px 0"><span style="color: #ff6e33;">NUNCA vendas nada a nadie fuera de tu pa\xEDs de residencia. </span><br />Una orden de pago de un banco extranjero puede tardar de 3 a 4 semanas o m\xE1s en ser procesada por tu banco. Mientras tanto, el monto es acreditado en tu cuenta, pero si el pago es falso, este monto ser\xE1 debitado de tu cuenta.</li><li style="margin: 5px 0"><span style="color: #ff6e33;">NUNCA aceptes un pago por un monto superior al valor de tu articulo. </span><br />NUNCA deberias enviar plata para reembolsar un sobrepago, cualquiera sea la razon que te dieron (regalo, costos de envio, cargos de aduana, cargos por intermediarios...)</li><li style="margin: 5px 0"><span style="color: #ff6e33;">Si el comprador se presenta a si mismo como un intermediario (abogado, consejero...) representando a su cliente extranjero, NO ACEPTES la venta.</span></li><li style="margin: 5px 0"><span style="color: #ff6e33;">OLX nunca toma partido en negociaciones o transacciones. </span><br />No facilitamos pagos ni envios; no proveemos garant\xEDa alguna de satisfacci\xF3n de producto; y no ofrecemos ning\xFAn servicio de financiamiento o protecci\xF3n financiera para compradores o vendedores.</li></ol><<AntiFraudForum>> <<AntiFraudHelp>><<ANONYMOUSUSER>><p>\xA1Te deseamos una transacci\xF3n exitosa en OLX!<br /><<FooterMail_01_Support>><br /></p><<REGISTEREDUSER>>', index: 5002},
    'mail_crm.CRM_FirstPost_031_AnonymousUser': {value: '<p style="color:#f00;"><strong>CONSEJO \xDATIL:</strong></p><p>No necesitas registrarte para usar OLX, pero te recomendamos que lo hagas:<br /><ul><li>Es m\xE1s f\xE1cil para manejar tus publicaciones.</li><li>Registrarse es r\xE1pido y gratis.</li></ul><p><a href="<<RegisterLink>>">\xA1Reg\xEDstrate ahora!</a></p>', index: 5003},
    'mail_crm.CRM_FirstPost_031_RegisteredUser': {value: 'Si no deseas recibir consejos de OLX, simplemente <<ModifEmailNotificationLink>> haz clic aqu\xED<</ModifEmailNotificationLink>> y desmarca la casilla: "Quiero recibir consejos sobre compra y venta en OLX".', index: 5004},
    'mail_crm.DoNotReply': {value: 'No respondas a este e-mail.', index: 5005},
    'mail_crm.FeatureYourAdCRM': {value: '<<LINK_FEATURED_LISTINGS>>\xA1Destaca tu anuncio<</LINK_FEATURED_LISTINGS>> para aumentar su visibilidad hasta 20 veces!', index: 5006},
    'mail_crm.HaveQuestionLink': {value: '<<CONTACTLINK>>\xBFTienes alguna pregunta?<</CONTACTLINK>>', index: 5007},
    'mail_crm.HelloUser': {value: 'Hola, <<USERNAME>>', index: 5008},
    'mail_crm.HoweverIfThePotencialBuyerSellerIsNotInYourAreaHereAreSomeRecommendations': {value: 'Sin embargo, si el posible comprador/vendedor no esta en su \xE1rea, aqu\xED te ofrecemos algunas recomendaciones que debes considerar:', index: 5009},
    'mail_crm.IncreaseVisitsPostPictures': {value: '\xA1Aumenta las visitas de tu anuncio, publicando fotos!', index: 5010},
    'mail_crm.InformationAboutYourAdItemTitle': {value: 'Informaci\xF3n sobre tu anuncio:<<ItemTitle>>', index: 5011},
    'mail_crm.RegisterMyOLX': {value: 'Mi OLX te permite gestionar los anuncios, destacarlos, ver qui\xE9n se ha puesto en contacto contigo y mucho m\xE1s. <<REGISTERLINK>>\xA1Reg\xEDstrate ahora!<</REGISTERLINK>>', index: 5012},
    'mail_crm.SafetyTips': {value: 'Consejos sobre seguridad', index: 5013},
    'mail_crm.SpamFolderAddOLX': {value: '\xBFHas recibido este mensaje en tu carpeta de spam? Agrega <xxxx@olx.com> a tu lista de contactos.', index: 5014},
    'mail_crm.ThankYou': {value: '\xA1Gracias por usar OLX!', index: 5015},
    'mail_crm.TipsPictures': {value: '\xA1Agrega fotos! Aqu\xED tienes algunos consejos para publicar las mejores:', index: 5016},
