    'mail_crm.UseQualityPics': {value: 'Usa fotos de calidad: \xA1una imagen vale m\xE1s que mil palabras!', index: 5018},
    'mail_crm.WantMorePeopleAd': {value: '\xBFQuieres que m\xE1s gente vea tu anuncio? <<ITEM_TITLE>>', index: 5019},
    'mail_crm.WeAdviseYouToDealLocallySoBothPartiesCanMeetBeforeProceeding': {value: 'Te recomendamos operar localmente, de esta manera, ambas partes puedan conocerse en persona antes de proceder con la transacci\xF3n.', index: 5020},
    'mail_crm.WeAdviseYouToKeepThisEmailItHasUsefulInformationForTransactions': {value: '<p>Te recomendamos conservar este e-mail, puede resultarte \xFAtil para futuras transacciones en sitios de subastas o clasificados.</p>', index: 5021},
