    'misc.PostingBalloonTip_Address_0_0': {value: 'Si escribes una direcci\xF3n, tu anuncio aparecer\xE1 en el mapa de las aplicaciones m\xF3viles de OLX. Si te incomoda mostrar la direcci\xF3n exacta, escribe la direcci\xF3n m\xE1s cercana de cualquier lugar de encuentro que consideres conveniente.', index: 10432},
    'misc.PostingBalloonTip_ContactName_0_0': {value: '<B>Escribe tu nombre real para que los compradores sepan c\xF3mo llamarte cuando te contacten.</B><UL><LI>No es necesario que escribas tu nombre completo.</LI></UL>', index: 10433},
    'misc.PostingBalloonTip_Description_0_0': {value: '<B>\xA1Agrega informaci\xF3n detallada en el campo de la descripci\xF3n para vender r\xE1pido!</B><UL><LI>Describe todas las caracter\xEDsticas que puedas acerca del producto o servicio que est\xE1s ofreciendo.</LI><LI>Tambi\xE9n agrega informaci\xF3n sobre c\xF3mo prefieres que te contacten (tel\xE9fono o e-mail) y c\xF3mo deseas concretar la transacci\xF3n.</LI></UL>', index: 10434},
    'misc.PostingBalloonTip_description_0_301': {value: 'Escribe informaci\xF3n detallada de tu propiedad: aire acondicionado, armarios, frente o patio, familiar, pensi\xF3n.', index: 10435},
    'misc.PostingBalloonTip_description_0_363': {value: '<B>\xA1Agrega informaci\xF3n detallada en el campo de la descripci\xF3n para alquilar m\xE1s r\xE1pido!</B><UL><LI>Detalla las caracter\xEDsticas de la propiedad: estado, \xE1rea, unidades por piso, cantidad de pisos, etc\xE9tera.</LI><LI>Recuerda informar sobre el tiempo de uso y la condici\xF3n del inmueble.</LI></UL>', index: 10436},
    'misc.PostingBalloonTip_description_0_367': {value: '<B>\xA1Agrega informaci\xF3n detallada en el campo de la descripci\xF3n para vender m\xE1s r\xE1pido!</B><UL><LI>Detalla las caracter\xEDsticas de la propiedad: estado, \xE1rea, unidades por piso, cantidad de pisos, etc\xE9tera.</LI><LI>Recuerda informar sobre el tiempo de uso y la condici\xF3n del inmueble.</LI></UL>', index: 10437},
    'misc.PostingBalloonTip_description_0_368': {value: '<B>\xA1Agrega informaci\xF3n detallada en el campo de la descripci\xF3n para vender o alquilar m\xE1s r\xE1pido!</B><UL><LI>Detalla las caracter\xEDsticas de la propiedad: estado, \xE1rea, unidades por piso, cantidad de pisos, etc\xE9tera.</LI><LI>Incluye aspectos importantes: aire acondicionado, cantidad de ba\xF1os, iluminaci\xF3n, entre otros.<LI>Recuerda informar sobre el tiempo de uso y la condici\xF3n del inmueble.</LI></UL>', index: 10438},
    'misc.PostingBalloonTip_description_0_376': {value: 'Escribe informaci\xF3n relacionada con el motor, documentos, combustible.', index: 10439},
    'misc.PostingBalloonTip_description_0_377': {value: '<B>\xA1Agrega informaci\xF3n detallada en el campo de la descripci\xF3n para vender r\xE1pido!</B><UL><LI>Escribe informaci\xF3n relacionada con el estado de conservaci\xF3n, las especificaciones t\xE9cnicas y la procedencia.</LI></UL>', index: 10440},
    'misc.PostingBalloonTip_description_0_378': {value: '<B>\xA1Agrega informaci\xF3n detallada en el campo de la descripci\xF3n para vender r\xE1pido!</B><UL><LI>Detalla las caracter\xEDsticas del carro: aire acondicionado, tipo de transmisi\xF3n, seguro autom\xE1tico para puertas y ventanas, alarma, bolsa de aire y est\xE9reo.</LI><LI>Recuerda informar sobre el tiempo de uso, el estado de conservaci\xF3n y el motivo de la venta.</LI></UL>', index: 10441},
