    'misc.ProhibitedItems': {value: '<li>Adopci\xF3n de ni\xF1os y beb\xE9s</li>.<li>Material para adultos o pornograf\xEDa</li>.<li>Alcohol</li>.<li>Animales de pelea o carrera</li>.<li>Sangre, fluidos corporales y partes del cuerpo</li>.<li>Herramientas para robar</li>.<li>Productos para falsificar</li>.<li>Base de datos</li>.<li>Equipos de vigilancia electr\xF3nica</li>.<li>Bienes embargados</li>.<li>Especies en peligro</li>.<li>Entradas para espect\xE1culos</li>.<li>Petardos</li>.<li>Fuegos artificiales, explosivos y sustancias explosivas</li>.<li>Identificaciones y licencias gubernamentales</li>.<li>Productos qu\xEDmicos peligrosos</li>.<li>Art\xEDculos peligrosos, restringidos o perecederos</li>.<li>Diplomas y certificados universitarios, etc</li>.<li>Equipos hospitalarios y est\xE9tica general</li>.<li>Partes y restos humanos</li>.<li>F\xE1rmacos ilegales</li>.<li>Art\xEDculos que violen las leyes de protecci\xF3n de bienes de importancia hist\xF3rica, art\xEDstica y cultural</li>.<li>Productos de marfil</li>.<li>Tiques de loter\xEDa, n\xFAmeros para sorteos</li>.<li>Material ofensivo, como el de ofensa \xE9tnica o racial</li>.<li>Productos farmac\xE9uticos (con receta m\xE9dica o sin ella)</li>.<li>No se permiten las fotograf\xEDas de artistas, a menos que se cuente con su permiso</li>.<li>Art\xEDculos relacionados con la pol\xEDtica, las Fuerzas Militares, Navales o A\xE9reas</li>.<li>Material pol\xEDtico</li>.<li>Productos que no tienen la aprobaci\xF3n ni el registro de las agencias gubernamentales, como GNC, spray de pimienta, GLP, cilindros</li>.<li>Programas para desbloquear tel\xE9fonnos y videojuegos</li>.<li>Acciones y otros t\xEDtulo</li>.<li>Equipos de vigilancia</li>.<li>Productos de tabaco</li>.<li>Premios y dem\xE1s ofertas irreales</li>.<li>Cosm\xE9ticos usados</li>.<li>Ropa interior usada</li>.<li>Armas y cuchillos</li>.<li>Productos derivados de animales silvestres: espec\xEDmenes disecados y marfil</li>.<li>Venta al por mayor o a granel de productos de marca (art\xEDculos electr\xF3nicos/tel\xE9fonos m\xF3viles)</li>.', index: 10518},
    'misc.ProhibitedItemsByLaw_List': {value: '<li>Art\xEDculos falsificados.</li><li>Rostros, nombres, firmas y art\xEDculos autografiados</li>.<li>Pirater\xEDa de programas y pel\xEDcula</li>.<li>Marcas de agua, logotipos o URLs de otros sitios web</li>.<li>Nuevas marcas de lujo</li>.', index: 10519},
    'misc.ProhibitedItemsTitle': {value: 'Art\xEDculos prohibidos y restringidos:', index: 10520},
    'misc.ProhibitedPractices': {value: '<li><strong>Publicaciones duplicadas</strong>: Cualquier anuncio que se publique m\xE1s de una vez con el mismo contenido o t\xEDtulo en la misma ciudad y categor\xEDa se considera anuncio duplicado. Sugerimos publicar varios anuncios solo si tienes diferentes art\xEDculos o servicios para vender. Se eliminar\xE1n los anuncios duplicados y se castigar\xE1 a quienes los publiquen, en caso de que el problema persista.</li><li><strong>Publicaci\xF3n de material de contenido sexual para adultos:</strong> No se permiten los clasificados relacionados con art\xEDculos destinados a su uso en actividades sexuales. Recuerda tambi\xE9n son inadecuados los t\xEDtulos que contienen lenguaje adulto expl\xEDcito, independientemente del art\xEDculo incluido en la publicaci\xF3n.</li><li>Escribir <strong>t\xEDtulos enga\xF1osos</strong></li><li>Cargar <strong>fotograf\xEDas inadecuadas o incorrectas</strong> con el anuncio</li><li>Publicar art\xEDculos en <strong>categor\xEDas inadecuadas</strong></li><li>Tergiversar la <strong>ubicaci\xF3n del art\xEDculo</strong></li><li>Cotizar un <strong>precio irreal</strong></li>', index: 10521},
    'misc.ProhibitedPracticesTitle': {value: 'Pr\xE1cticas prohibidas:', index: 10522},
    'misc.ProhibitedServices': {value: '<li>Servicios de masajes para adultos</li>.<li>Cualquier tipo de servicio gubernamental: solo se permiten servicios de asesor\xEDa y orientaci\xF3n</li>.<li>Servicios env\xEDo masivo de SMS y correos electr\xF3nicos</li>.<li>Acompa\xF1antes</li>.<li>Servicios de marketing multinivel</li>.<li>Personas que buscan relaciones, citas o amistad</li>.<li>Esquemas de obtenci\xF3n r\xE1pida de riqueza</li>.<li>Vientres de alquiler</li>.', index: 10523},
