    'misc.ThankYouForUsingBrand': {value: '\xA1Gracias por utilizar OLX! Su anuncio estar\xE1 disponible en menos de 6 horas. Por favor, vea los detalles de su anuncio a continuaci\xF3n:', index: 10768},
    'misc.ThankYouMessage': {value: '\xA1Felicidades! \xA1hemos enviado tu mensaje! Cuantos m\xE1s anuncios respondas, m\xE1s posibilidades tendr\xE1s de conseguir una buena oferta.<br /><br />\xBFPor qu\xE9 no miras su hay alg\xFAn otro anuncio interesante?<<LINK_GO_TO_YOUR_RESULTS>>Ir a los resultados.<</LINK_GO_TO_YOUR_RESULTS>>', index: 10769},
