    'misc.TipsForBuyers': {value: 'Recomendaciones para los compradores:', index: 10773},
    'misc.TipsForBuyersList': {value: '<li>Compra productos locales para que puedas inspeccionar el art\xEDculo, encontrarte con el vendedor y pagar al momento de recoger el art\xEDculo o cuando se te hace la entrega. Recuerda concertar el encuentro en un lugar seguro. </li><li>La mejor manera de realizar la transacci\xF3n es intercambiando el art\xEDculo por el dinero simult\xE1neamente. </li><li>Pide informaci\xF3n clara sobre el estado del producto, el precio, la forma de pago y de entrega.</li><li>Usa solo formas de pago que conf\xEDas y que te resulten familiares.</li><li>P\xEDdele al vendedor un n\xFAmero de seguimiento si se ha despachado el producto. </li><li>P\xEDdele al vendedor un n\xFAmero de tel\xE9fono que pueda verificarse.</li><li>En caso de productos electr\xF3nicos, carros y bicicletas, debes probar el funcionamiento del producto antes de comprarlo.</li><li>Haz una investigaci\xF3n comparativa de precios de ese producto.</li><li>No compartas tu informaci\xF3n financiera. </li><li>Usa siempre el e-mail del vendedor para comunicarte con \xE9l. Esto nos permitir\xE1 avisarte inmediatamente si contamos con informaci\xF3n sobre actividades fraudulentas por parte del vendedor.</li>', index: 10774},
    'misc.TipsForSellers': {value: 'Recomendaciones para los vendedores:', index: 10775},
    'misc.TipsForSellersList': {value: '<li>Es preferible recibir el pago completo al momento de la entrega. Recuerda concertar el encuentro en un lugar seguro.</li><li>Verifica las credenciales del vendedor si hay una solicitud de compra al por mayor.</li><li>P\xEDdele al vendedor un n\xFAmero de tel\xE9fono que pueda verificarse.</li><li>Aseg\xFArate de que tu producto cumpla con las caracter\xEDsticas publicadas en tu anuncio, a fin de evitar malentendidos con el comprador.</li><li>No compartas informaci\xF3n financiera excepto la que sea necesaria para realizar el pago.</li>', index: 10776},
