    'payment.Unlimited_Access_To_All_OLX': {value: 'Acceso ilimitado a todo OLX por 30 minutos (Buscar, navegar, contactar, publicar...)', index: 11418},
    'payment.We_Could_Not_Charge_You_Properly': {value: 'No pudimos procesar adecuadamente su pago. Por favor cont\xE1ctese con el servicio de atenci\xF3n al cliente de Globe.', index: 11419},
    'payment.You_Can_Now_Use_Unlimited_OLX': {value: 'Ahora puede utilizar los servicios de OLX ilimitadamente por 30 minutos.', index: 11420},
    'mail_crm2.BeCautiousAboutSellersWithVeryPoorLanguageSkills': {value: '<li><strong>Cuidado </strong> con los vendedores que te contactan y que tienen un nivel muy pobre de tu idioma nativo. Como regla general, no respondas anuncios publicados en otro idioma que no sea el tuyo.</li>', index: 11421},
    'mail_crm2.BrandNeverTakesPartInTransactions': {value: '<li><strong>OLX NUNCA participes en las transacciones, aun cuando el vendedor indique lo contrario</strong>. Si recibes tal declaraci\xF3n, simplemente ign\xF3rala.<ol><li>No nos involucramos en negociaciones, transacciones ni env\xEDos.</li><li>No ofrecemos servicios de financiaci\xF3n, protecci\xF3n a los compradores ni certificaci\xF3n de vendedores.</li><li>Si recibes alg\xFAn e-mail que pareciera ser enviado por OLX y en el que te garantizan la transacci\xF3n o el env\xEDo, RECHAZA la transacci\xF3n.</li></ol></li>', index: 11422},
    'mail_crm2.crm_ContactSeller_Body1': {value: 'Has respondido por primera vez a un anuncio publicado en OLX, y deseamos aprovechar esta oportunidad para sugerirle c\xF3mo obtener una experiencia segura.<br /><br />En primer lugar, te recomendamos reunirte con el vendedor para asegurarte su fiabilidad y la calidad del producto del anuncio. Esta es, de lejos, la forma m\xE1s eficiente y segura de operar.<br /><br />Sin embargo, si esto no fuera posible, aqu\xED te dejamos algunos consejos:<br /><br />', index: 11423},
    'mail_crm2.crm_ContactSeller_Body2': {value: '<li><strong>LOS REGALOS GRATUITOS</strong>, tales como camionetas o vans, carros, motos, cuatriciclos, animales valiosos, etc. <strong> NO EXISTEN </strong>.<br />Estas son estafas, especialmente si los (falsos) bienes son de otro pa\xEDs, y t\xFA "SOLO PAGAS" el costo de env\xEDo.</li><br /><li><strong>NO COMPRES</strong> un veh\xEDculo si el vendedor dice que no vive en tu pa\xEDs o no es de all\xED (por cualquier raz\xF3n).</li><br /><li>Los televisores de pantalla plana, las c\xE1maras fotogr\xE1ficas o de video, las computadoras nuevas que se venden con el <strong>50 o 75 % de descuento desde un pa\xEDs extranjero, en realidad, no existen</strong>.</li><br /><li><strong>Ten cuidado </strong> con los vendedores que te contactan con un nivel muy pobre de tu idioma nativo. Como regla general, no respondas anuncios publicados en otro idioma que no sea el tuyo.</li><br /><li><strong>No compres animales fuera de tu pa\xEDs</strong>. Respeta las leyes actuales. Ten en cuenta especialmente que comercializar ciertos animales "ex\xF3ticos" est\xE1 prohibido.</li><br /><li><strong>OLX NUNCA participa en las transacciones, aun cuando el vendedor indique lo contrario</strong>. Si recibes tal declaraci\xF3n, simplemente ign\xF3rala.<ol><li>No nos involucramos en negociaciones, transacciones ni env\xEDos.</li><li>No ofrecemos servicios de financiaci\xF3n, protecci\xF3n a los compradores ni certificaci\xF3n de vendedores.</li><li>Si recibes un e-mail que pareciera ser enviado por OLX y en el cual te garantizan la transacci\xF3n o el env\xEDo, RECHAZA la transacci\xF3n.</li></ol></li>', index: 11424},
    'mail_crm2.crm_ContactSeller_Body3': {value: '<br /><<AntiFraudForum>> <<AntiFraudHelp>><br />Te deseamos una transacci\xF3n exitosa.<br /> <br />', index: 11425},
    'mail_crm2.crm_ContactSeller_Subject': {value: 'Respondiste al anuncio: <<ItemTitle>>', index: 11426},
    'mail_crm2.DearUser': {value: 'Estimado usuario:', index: 11427},
    'mail_crm2.DoNotPurchaseAnimalsFromOutsideYourCountry': {value: '<li><strong>No compres animales fuera de tu pa\xEDs</strong>. Respeta las leyes actuales. Ten en cuenta, especialmente, que comercializar ciertos animales "ex\xF3ticos" est\xE1 prohibido.</li>', index: 11428},
    'mail_crm2.HoweverIfThisIsNotPossibleHereIsSomeAdvice': {value: 'Sin embargo, si esto no fuera posible, te dejamos algunos consejos:', index: 11429},
    'mail_crm2.NeverPayTheSellerForDeliveringAnAnimalToYou': {value: '<li><strong>NUNCA</strong> le pagues al vendedor por enviarte el animal. Lo m\xE1s probable es que el animal no exista. Es un pretexto para obtener tu dinero.</li>', index: 11430},
    'mail_crm2.NeverPayThroughWesternUnionEspeciallySomeoneWhoIsAbroad': {value: '<li><strong>NUNCA pagues a trav\xE9s de Western Union</strong> especialmente a alguien que es extranjero o que est\xE1 fuera de tu pa\xEDs.</li>', index: 11431},
    'mail_crm2.ThereAreNoGiftsOfValuableAnimals': {value: '<li><strong>NO EXISTEN LOS ANIMALES VALIOSOS ENTREGADOS COMO REGALO.</strong> Lo m\xE1s probable es que se trate de un fraude o enga\xF1o, especialmente si el (falso) animal no est\xE1 en tu pa\xEDs, y t\xFA "SOLO" debas pagar el env\xEDo.</li>', index: 11432},
    'mail_crm2.WeRecommendYouMeetTheSellerToSeeExistenceAndHealthOfAnimal': {value: 'Especialmente, te recomendamos que te encuentres personalmente con el vendedor para asegurarte de que el animal en venta existe y tiene buena salud. Esta es, de  lejos, la mejor manera y la m\xE1s segura de concretar una transacci\xF3n.', index: 11433},
    'mail_crm2.WeSuggestYouSaveThisEmailYouWillFindUsefulInformation': {value: '<br /><span>Te sugerimos conservar este e-mail. Encontrar\xE1s informaci\xF3n \xFAtil para comprar en sitios de subastas y clasificados.</span>', index: 11434},
    'mail_crm2.YouRecentlyRepliedToAnAdInTheAnimalCategoryOnBrand': {value: 'Recientemente respondiste a un anuncio en la categor\xEDa de animales en OLX por primera vez. A fin de ayudarte a que tu b\xFAsqueda y transacci\xF3n sean satisfactorias, aqu\xED te dejamos varias recomendaciones.', index: 11435},
