    'advertising.InstructionsAdWords01': {value: 'Google es responsable de vender enlaces patrocinados en OLX. Al comprar Google Adwords, compras enlaces patrocinados y los env\xEDas a OLX. Si todav\xEDa no tienes una cuenta, puedes crearla en <<ADWORDSLINK>>Google Adwords<</ADWORDSLINK>>. Y si ya tienes una, sigue las instrucciones a continuaci\xF3n para enviar tus anuncios a OLX.', index: 11477},
