    'featured_listings.AdditionalTermsForFeaturedAds': {value: 'T\xE9rminos adicionales para anuncios destacados', index: 11495},
    'featured_listings.AdditionalTermsForFeaturedAds_content': {value: 'Estos t\xE9rminos adicionales, junto con los <<LINK_TERMS_USE>>T\xE9rminos y condiciones<</LINK_TERMS_USE>> del sitio, rigen el uso de los anuncios destacados:<br /><ul><li>Como prueba de pago de un Anuncio destacado, OLX solo emitir\xE1 una \u201COrden de confirmaci\xF3n\u201D, que ver\xE1s al finalizar el proceso de pago, y una confirmaci\xF3n por e-mail.</li><li>Si por alguna raz\xF3n, ya sea t\xE9cnica o de cualquier otra naturaleza, tu anuncio no se muestra en la zona de \u201CAnuncios destacados\u201D, la \xFAnica obligaci\xF3n de OLX ser\xE1 la de agregar tu anuncio en la zona de "Anuncios destacados" tan pronto como sea posible.</li><li>Un tercero provee los servicios de facturaci\xF3n.</li><li>Seg\xFAn el \xFAnico criterio de OLX, los anuncios que sean ofensivos, pornogr\xE1ficos, spam (incluida la duplicaci\xF3n de anuncios), posibles estafas o que puedan infringir los derechos de autor, no ser\xE1n destacados y el pago no ser\xE1 reembolsado.</li><li>ESTE SERVICIO DE ANUNCIOS DESTACADOS SE PROVEE EN BASE A "SU CONDICI\xD3N ACTUAL" O "SU DISPONIBILIDAD", SIN NING\xDAN TIPO DE  GARANT\xCDAS Y EN LA M\xC1XIMA EXTENSI\xD3N DE LO QUE PERMITE LA LEY.  OLX NO GARANTIZA, REPRESENTA NI ASUME OBLIGACI\xD3N LEGAL NI RESPONSABILIDAD ALGUNA POR LA INTEGRIDAD, COMPLETITUD O EXACTITUD DEL CONTENIDO LISTADO EN EL SERVICIO DE ANUNCIOS DESTACADOS.</li></ul>', index: 11496},
    'featured_listings.AdFeaturedHomepage_Wait': {value: 'Tu anuncio est\xE1 actualmente destacado en la p\xE1gina inicial. Recuerda que puedes destacarlo en las listas.Espera a que termine el per\xEDodo de anuncio destacado antes de promocionarlo nuevamente en la p\xE1gina inicial.', index: 11497},
    'featured_listings.AdFeaturedListings_Wait': {value: 'Tu anuncio est\xE1 actualmente destacado en nuestra lista. Espera a que termine el per\xEDodo de anuncio destacado antes de promocionarlo nuevamente.', index: 11498},
    'featured_listings.AdsFeaturedGet20TimesMore': {value: 'Los anuncios destacados de nuestras p\xE1ginas tienen una visibilidad 20 veces mayor y se venden m\xE1s r\xE1pido que los anuncios normales.', index: 11499},
