    'featured_listings.UnableToFeature_NoImages_NoPrice': {value: 'Solo podr\xE1s promocionar tu anuncio si especificas el precio y agregas una foto. Actualiza tu anuncio. Solo te tomar\xE1 un minuto', index: 11585},
    'featured_listings.UnableToFeature_NoImages_NoPrice_Outdated': {value: 'Tu anuncio se public\xF3 hace m\xE1s de un mes, actual\xEDzalo antes de destacarlo en OLX. Solo te tomar\xE1 un minuto. Recuerda que debes especificar el precio y agregar, por lo menos, una foto para promocionar tu anuncio.', index: 11586},
