    'featured_listings.VerifyPendingOp': {value: 'Hemos verificado que tienes una operaci\xF3n pendiente relacionada con el anuncio que intentas pagar. <<LINK>>Feature another ad<</LINK>>!', index: 11592},
    'featured_listings.WaitForCallsFromProspectiveBuyers': {value: '\xA1Prep\xE1rate para todas las llamadas de tus posibles clientes!', index: 11593},
    'featured_listings.WedLikeToHelpYouCompleteTheProcess': {value: 'Queremos ayudarte a completar el proceso y aprovechar OLX al m\xE1ximo.', index: 11594},
    'featured_listings.WeHaveReceivedYourRequest': {value: 'Hemos recibido tu solicitud y la revisaremos en las pr\xF3ximas 24 horas.', index: 11595},
    'featured_listings.WhyCantIModifyMyListing': {value: '\xBFPor qu\xE9 no puedo modificar mi anuncio?', index: 11596},
    'featured_listings.WhyCantIModifyMyListing_content': {value: 'Para garantizar que el usuario tenga una buena experiencia (ya que puede haber agregado tu anuncio a sus favoritos), no se permite la modificaci\xF3n de anuncios destacados hasta el vencimiento de la opci\xF3n Destacado.<br /><br />Si quieres hacer cambios en tus anuncios destacados, tienes dos opciones:<br /><ul><li>Esperar hasta que finalice el per\xEDodo de Destacado, o modificar tu anuncio y comprar nuevamente un Anuncio destacado. </li><li>Si son cambios realmente importantes, <<CONTACTLINK>>comun\xEDcate con nuestro Equipo de atenci\xF3n al cliente<</CONTACTLINK>>.</li></ul>', index: 11597},
    'featured_listings.YouCanChooseWhereToFeatureYourAd': {value: 'Puedes elegir destacar tu anuncio en nuestra p\xE1gina de inicio o en la secci\xF3n correspondiente a tu anuncio (o en ambos).', index: 11598},
