    'featured_listings.YourAdWillBeFeaturedSoon': {value: 'Tu anuncio se destacar\xE1 en breve. Aparecer\xE1 en l\xEDnea una vez que nuestro equipo lo haya revisado dentro del siguiente d\xEDa h\xE1bil.', index: 11600},
